script: |
  super -f text -I q6209.spq | sort > q6209.out

inputs:
  - name: q6209.spq
    data: |
      SELECT - col2 + - ( - ( 31 ) ) * + 4 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 <= ( - + col0 + + 38 * 79 + - + 5 + + col1 + - - 66 / + + col0 * - - 52 / - 9 );
  - name: tab2

outputs:
  - name: q6209.out
    data: |
      101
      66
      84
